// Update LoginButton component to accept handleLogin prop
import React from 'react';
import { Button } from '@mui/material';

const LoginButton = ({ handleLogin }) => (
    <Button
        variant="contained"
        color="primary"
        onClick={handleLogin}
        style={{ fontWeight: 'bold' }}
    >
        Log in
    </Button>
);

export default LoginButton;
